import { Link } from "react-router-dom";

export default function Navbar() {
  return (
    <nav className="bg-gray-900 text-white p-4 flex justify-between items-center">
      <h1 className="text-2xl font-bold">Cuevana Clone</h1>
      <div className="space-x-4">
        <Link to="/dashboard" className="hover:text-gray-400">Dashboard</Link>
        <Link to="/generos" className="hover:text-gray-400">Géneros</Link>
        <Link to="/directores" className="hover:text-gray-400">Directores</Link>
        <Link to="/productoras" className="hover:text-gray-400">Productoras</Link>
        <Link to="/tipos" className="hover:text-gray-400">Tipos</Link>
        <Link to="/media" className="hover:text-gray-400">Películas</Link>
      </div>
    </nav>
  );
}
